private void readObject(ObjectInputStream in)
    throws IOException, ClassNotFoundException {
  in.defaultReadObject();
  int len = in.readInt();
  if (len < 0 || len > MAX_SIZE) {
    throw new IOException("Illegal buffer length " + len);
  }
  byte[] x = new byte[len];
  in.readFully(x);
  fd = ByteBuffer.wrap(x);
}
